import React from 'react';

const About = () => {
    return(
        <div 
            className = "ui raised very padded text container segment"
            style = {{marginTop: "80px"}}
        >
            <h3 className = "ui header">About</h3>
            <p>All about React!</p>

        </div>
    )
}

export default About;
